export const styles = theme => ({
    landingsearchform: {
        display: "contents",
    },
    landingsearchwrapper: {
        marginTop: 32,
        marginBottom: 32,
        padding: 13,
    },
    landingsearchlabel: {
        display: "block",
        marginTop: 13,
    },
    searchsubmitbtn: {
        width: "100%",
        fontSize: 16,
        textTransform: "uppercase"
    },
    searchfield: {
        maxWidth: "97%",
    }
});
